window.bookSummaryJSON = "<p>I know many things. What I am capable of, what I will change, what I will become. But there is one thing I will never know. </p> <p>The veil I've worn from birth carries with it a terrible loneliness, a suppression I cannot imagine ever being free of. </p> <p><i>Some things never change...</i> </p> <p>My mother will always hate me. Her court will always shun me. </p> <p><i>â€¦until they do.</i> </p> <p>When the peace delegation arrives from the savage world of Glacium, my life is shoved wildly out of control by the handsome Prince Kedrick, who, for unfathomable reasons, shows me kindness. </p> <p><i>And the harshest lessons are learned.</i> </p> <p>Sometimes it takes the world bringing you to your knees to find that spark you thought forever lost. Sometimes it takes death to show you how to live. </p> <p>Warning: cliff-hanger ending! Suitable for mature young adult listeners due to swearing. </p>"; 
